Created attachment 830
Error messages shown by firebug

There is a problem with the qooxdoo table when hiding the header cells.

How to reproduce:

- implement a table
- call the two methods: qx.ui.table.Table.setHeaderCellsVisible(false) and qx.ui.table.Table.setColumnVisibilityButtonVisible(false) to hide the header row.

Afterwards, the header cells aren't visible.
When moving the mouse over the data rows in the table an error occurs several times.

It happens in the following line of the class qx.ui.table.pane.Scroller:

_getColumnForPageX : function(pageX) 
{ 
 var columnModel = this.getTable().getTableColumnModel(); 
 var paneModel = this.getTablePaneModel(); 
 var colCount = paneModel.getColumnCount(); 
 var currX = this.__header.getContainerLocation().left;
 // the previous line causes an error
  .......
}

The error message is:
this.__header.getContainerLocation() is null



example code for the playground:
{
  var rowData= [[12, "value"], [13, "dkdk"]];

  // table model
  var tableModel = new qx.ui.table.model.Simple();
  tableModel.setColumns([ "ID", "Value"]);
  tableModel.setData(rowData);

  // table
  var table = new qx.ui.table.Table(tableModel);

  table.set({
    width: 600,
    height: 400,
    decorator : null
  });

  // set Header invisible causes crash
  table.setHeaderCellsVisible(false);
  table.setColumnVisibilityButtonVisible(false);

  var doc = this.getRoot();

  // Add button to document at fixed coordinates
  doc.add(table,
  {
    left : 100,
    top  : 50
  });
}

